import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
            <Main />
          </p>
        </header>
      </div>
    );
  }
}

class Main extends Component{
  render() {
    return(
      <div className='main'>Main div</div>
    )
  }
}

export default App;
